import React, { Component } from "react";
import { connect } from "react-redux";
import { NavLink } from "react-router-dom";

import {
  NavbarLeftStyle,
  LogoContainer,
  LinkContainer
} from "../../assets/components/layout/Navbar.style";
import logo from "./../../assets/images/logo.png";

class Navbar extends Component {
  constructor(props) {
    super(props);
    this.state = {
      active: true
    };
  }

  showMenu() {
    this.setState({
      active: !this.state.active
    });
  }

  render() {
    return (
      <div>
        <NavbarLeftStyle className={this.state.active ? "active" : "inactive"}>
          <LogoContainer>
            <img src={logo} alt="logo entreprise" className="logo" />
            <p> Stellar Dashboard </p>
          </LogoContainer>

          <LinkContainer>
            <ul>
              <li>
                <NavLink activeClassName="active" to="/dashboard/general">
                  Général
                </NavLink>
              </li>
              <li>
                <NavLink to="/dashboard/invoice">Factures</NavLink>
              </li>
              <li>
                <NavLink to="/dashboard/general">Patients</NavLink>
              </li>
              <li>
                <NavLink to="/signout">Déconnexion</NavLink>
              </li>
            </ul>
          </LinkContainer>
        </NavbarLeftStyle>
      </div>
    );
  }
}

const mapStateToProps = state => {
  return {};
};

export default connect(
  mapStateToProps,
  null
)(Navbar);
